import React, { useEffect } from "react";
import { View, Text, Image } from "react-native";
import { StyleSheet } from "react-native";
import { useSelector } from "react-redux";
import { FlatList } from "react-native-gesture-handler";
import { IUserObject } from '../types';

export default function Contacts({ path }: { path: string }) {
  const onlineUsers = useSelector((state: any) => state.onlineUsers);

  return (
    <View>
      <View>
        <Text style={styles.header}>Contacts here</Text>
        <FlatList
          data={onlineUsers}
          renderItem={({ item }) => {
            return <View>
              <Image style={styles.image} source={{uri: item.avatar}} />
              <Text style={styles.header}>{item.username}</Text>
              </View>;
          }}
          keyExtractor={(item : any) => item.userId}
        ></FlatList>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#fff",
  },
  header: {
    fontSize: 28,
    color: "#fff",
  },
  text: {
    fontSize: 16,
    color: "#fff",
  },
  image: {
    width: 100,
    height: 100,
    borderRadius: 50,
  }
});
